import {Link} from 'react-router-dom';

const RouteTest = () => {
    return (
        <>
            <Link to={"/"}> Home </Link>
            <br />
            <Link to={"/room"}> Room </Link>
            <br />
            <Link to={"/edit"}> Edit </Link>

        </>
    )
}

export default RouteTest;
